[{"location":"construction/integrating/#Integrating","page":"Integrating","title":"Integrating","text":"","category":"section"},{"location":"construction/integrating/#Complete-intervals","page":"Integrating","title":"Complete intervals","text":"","category":"section"},{"location":"construction/integrating/","page":"Integrating","title":"Integrating","text":"We are interested in integrating the smoothed interpolation from the start to some t  t_1. To compute this efficiently we need to know the integral of the interpolation over the various intervals. More precisely:","category":"page"},{"location":"construction/integrating/","page":"Integrating","title":"Integrating","text":"For the linear sections we obtain","category":"page"},{"location":"construction/integrating/","page":"Integrating","title":"Integrating","text":"beginequation\n    int_t_i-1+fraclambda2^t_i-fraclambda2 \n         u_i-1 + fracDelta u_iDelta t_i(tau - t_i-1)\n    textdtau\n    =\n    (1 - lambda)Delta t_i \n    left\n        u_i-1\n        +\n        frac12(1 - lambda) Delta u_i\n    right\nendequation","category":"page"},{"location":"construction/integrating/","page":"Integrating","title":"Integrating","text":"For the spline sections we obtain","category":"page"},{"location":"construction/integrating/","page":"Integrating","title":"Integrating","text":"beginequation\n    beginaligned\n        int_t_i-fraclambda2^t_i + fraclambda2 u_i(tau)textdtau\n        =\n        int_0^1 T_i(s)u_i(T_i(s))textds  \n        =\n        int_0^1\n            leftlambda(Delta t_i+1 - Delta t_i)s + lambdaDelta t_iright\n            leftfraclambda2(Delta u_i+1 - Delta u_i)s^2 + lambda Delta u_i s + u_i - fraclambda2right\n        textds \n        = fraclambda^224\n        left\n            Delta t_i left(-3Delta u_i + Delta u_i+1right) +\n            Delta t_i+1 left(-Delta u_i + 3 Delta u_i+1right)\n        right\n        +\n        fraclambda2(Delta t_i + Delta t_i+1)u_i\n    endaligned\nendequation","category":"page"},{"location":"construction/integrating/#Incomplete-intervals","page":"Integrating","title":"Incomplete intervals","text":"","category":"section"},{"location":"construction/integrating/","page":"Integrating","title":"Integrating","text":"We now define the new set of points (tildemathbfp_j)_j=1^2n given by all the mathbfp_i - fraclambda2 mathbfp_i+ fraclambda2 and the original boundary points, sorted by t. Then for t in lefttildet_J-1 tildet_Jright we have","category":"page"},{"location":"construction/integrating/","page":"Integrating","title":"Integrating","text":"beginequation\n    beginaligned\n        U(t) = int_t_1^t u(tau)textdtau = sum_j = 2^J-1 int_tildet_j-1^tildet_j u(tau)textdtau + int_tildet_J-1^t u(tau)textdtau\n    endaligned\nendequation","category":"page"},{"location":"construction/integrating/","page":"Integrating","title":"Integrating","text":"Where the summed integrals are given by the values above. For the last integral:","category":"page"},{"location":"construction/integrating/","page":"Integrating","title":"Integrating","text":"If J is odd then the last integral is of a linear section:","category":"page"},{"location":"construction/integrating/","page":"Integrating","title":"Integrating","text":"beginequation\n    int_tildet_J-1^t u(tau)textdtau = left((t-t_I) - fraclambda2Delta t_I+1right)u_I\n    + \n    frac12fracDelta u_I+1Delta t_I+1left(t-t_I)^2 - fraclambda^24Delta t_I+1^2right\nendequation","category":"page"},{"location":"construction/integrating/","page":"Integrating","title":"Integrating","text":"where I = fracJ-12.","category":"page"},{"location":"construction/integrating/","page":"Integrating","title":"Integrating","text":"If J is even the last integral is of a spline section:","category":"page"},{"location":"construction/integrating/","page":"Integrating","title":"Integrating","text":"beginequation\n    beginaligned\n        int_tildet_J-1^t u_I(tau)textdtau = \n        int_0^S_I(t) T_I(s)u_Ileft(T_I(s)right)textds \n        =\n        int_0^S_I(t)\n            leftlambda(Delta t_I+1 - Delta t_I)s + lambdaDelta t_Iright\n            leftfraclambda2(Delta u_I+1 - Delta u_I)s^2 + lambda Delta u_I s + u_I - fraclambda2right\n        textds\n    endaligned\nendequation","category":"page"},{"location":"construction/integrating/","page":"Integrating","title":"Integrating","text":"where I = fracJ2.","category":"page"},{"location":"construction/motivation/#Motivation","page":"Motivation ","title":"Motivation","text":"","category":"section"},{"location":"construction/motivation/","page":"Motivation ","title":"Motivation ","text":"I didn't like the options available in DataInterpolations.jl for my application, so I came up with my own concept that mainly keeps the linear interpolation intact, but rounds of the corners between the linear sections. The main recipe is this, per corner:","category":"page"},{"location":"construction/motivation/","page":"Motivation ","title":"Motivation ","text":"Add 2 points on either side close to the corner, on their respectilve linear sections;\nRemove the corner point;\nConnect the 2 new points with a spline curve.","category":"page"},{"location":"construction/motivation/","page":"Motivation ","title":"Motivation ","text":"The advantage of the spline curve over a polynomial one is that the connection can be C^1 smooth (i.e. the smoothed curve and its derivative are continuous) without the possibility of introducing large oscillations with the use of degree 3 polynomials.","category":"page"},{"location":"construction/motivation/#Application","page":"Motivation ","title":"Application","text":"","category":"section"},{"location":"construction/motivation/","page":"Motivation ","title":"Motivation ","text":"The original application for this package is Ribasim, where smooth interpolation can help with the convergence of solving the non-linear ODE problem.","category":"page"},{"location":"api/#API","page":"API","title":"API","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"Documentation for SmoothInterpolation.jl's public interface.","category":"page"},{"location":"api/","page":"API","title":"API","text":"SmoothedLinearInterpolation","category":"page"},{"location":"api/#SmoothInterpolation.SmoothedLinearInterpolation","page":"API","title":"SmoothInterpolation.SmoothedLinearInterpolation","text":"SmoothedLinearInterpolation(u, t; λ = 0.25, extrapolate = false)\n\nThe method of interpolating between the data points using a linear polynomial, with an anterval around the corner points being replaced by a smooth spline section.\n\nArguments\n\nu: data points.\nt: time points.\n\nKeyword Arguments\n\nextrapolate: boolean value to allow extrapolation. Defaults to false.\nλ: The relative size of the spline interval. The interval extents a fraction λ/2 towards the neighbouring time points.\n\n\n\n\n\n","category":"type"},{"location":"construction/inverting_the_integral/#Inverting-the-integral","page":"Inverting the integral","title":"Inverting the integral","text":"","category":"section"},{"location":"construction/inverting_the_integral/","page":"Inverting the integral","title":"Inverting the integral","text":"We are interested in inverting U(t) as defined above. Note that U(t) is invertible if u(t) is positive for all t  t_1. If we define","category":"page"},{"location":"construction/inverting_the_integral/","page":"Inverting the integral","title":"Inverting the integral","text":"beginequation\n    U_J = int_t_1^tildet_Ju(tau)textdtau = sum_j = 2^J int_tildet_j-1^tildet_j u(tau)textdtau\nendequation","category":"page"},{"location":"construction/inverting_the_integral/","page":"Inverting the integral","title":"Inverting the integral","text":"then solving U(t) = V for t where V in U_J-1 U_J amounts to solving","category":"page"},{"location":"construction/inverting_the_integral/","page":"Inverting the integral","title":"Inverting the integral","text":"beginequation\n    int_tildet_J-1^t u(tau)textdtau = V - U_J-1\nendequation","category":"page"},{"location":"construction/inverting_the_integral/","page":"Inverting the integral","title":"Inverting the integral","text":"For linear sections this yields a quadratic equation in t with solution","category":"page"},{"location":"construction/inverting_the_integral/","page":"Inverting the integral","title":"Inverting the integral","text":"beginequation\n    t = t_I + left-fracu_IDelta u_I+1 + textsignleft(fracu_I+1u_I+1right)sqrtleft(fracu_IDelta u_I+1right)^2 +lambdaleft(fracu_IDelta u_I+1 + fraclambda4right) +2fracV - U_J-1Delta t_I+1Delta u_I+1rightDelta t_I+1\nendequation","category":"page"},{"location":"construction/inverting_the_integral/","page":"Inverting the integral","title":"Inverting the integral","text":"For spline sections this leads to a quartic equation in s:","category":"page"},{"location":"construction/inverting_the_integral/","page":"Inverting the integral","title":"Inverting the integral","text":"beginequation\n    beginaligned\n        3(Delta t_I+1 - Delta t_I)(Delta u_I+1 - Delta u_I)s^4 + \n        4Delta t_I (Delta u_I+1 - Delta u_I) s^3 + \n        12(Delta t_I+1 - Delta t_I)left(Delta u_I + fracu_I - fraclambda2lambdaright)s^2 + \n        24 Delta u_I left(Delta u_I + fracu_I - fraclambda2lambdaright) s + \n        - frac24lambda^2(V - U_J-1) = 0\n    endaligned\nendequation","category":"page"},{"location":"construction/inverting_the_integral/","page":"Inverting the integral","title":"Inverting the integral","text":"This quartic equation can be solved with the quartic formula.","category":"page"},{"location":"construction/inverting_the_integral/","page":"Inverting the integral","title":"Inverting the integral","text":"Quartic equation at Wolfram Alpha","category":"page"},{"location":"examples/#Examples","page":"Examples","title":"Examples","text":"","category":"section"},{"location":"examples/#Smoothed-linear-interpolation","page":"Examples","title":"Smoothed linear interpolation","text":"","category":"section"},{"location":"examples/#An-example-of-smoothed-linear-interpolation","page":"Examples","title":"An example of smoothed linear interpolation","text":"","category":"section"},{"location":"examples/","page":"Examples","title":"Examples","text":"import Random # hide\nRandom.seed!(2) # hide\nusing SmoothInterpolation\n\nu = rand(10)\nt = cumsum(rand(10))\n\nitp = SmoothedLinearInterpolation(u, t; extrapolate = true)","category":"page"},{"location":"examples/","page":"Examples","title":"Examples","text":"using Plots\nscatter(itp.t, itp.u, label = \"Input\")\nplot!(itp, label = \"Smoothed Linear Interpolation\")","category":"page"},{"location":"examples/#The-effect-of-the-parameter-λ","page":"Examples","title":"The effect of the parameter λ","text":"","category":"section"},{"location":"examples/","page":"Examples","title":"Examples","text":"using ColorSchemes\nt = [0, 1, 2, 2.5, 3, 3.5, 4]\nu = Float64[-1, 1, -1, 0, 1, 0, -1]\npl = plot()\nscatter!(t, u, label = \"Input\", legend = :top)\nN = 101\nΛ = range(0, 1, length = N)\ncolors = cgrad(:jet, range(0, 1, length = N))\n\nfor (i, (λ, color)) in enumerate(zip(Λ, colors))\n    itp = SmoothedLinearInterpolation(u, t; λ)\n    label = i % 10 == 1 ? \"λ = $λ\" : nothing \n    plot!(itp; label, color)\nend\n\npl","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/#Construction-of-smoothed-linear-interpolation","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"","category":"section"},{"location":"construction/construction_smoothed_linear_interpolation/#Linear-interpolation","page":"Construction of smoothed linear interpolation","title":"Linear interpolation","text":"","category":"section"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"Given is the set of points (mathbfp_i)_i=1^n in mathbbR^2, where we write t and u for the respective coordinates. We assume that the t_i are strictly increasing. Linear interpolation of these points is then simply given by","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"beginequation\n    u_t_i-1 t_i(t) = fracu_i-u_i-1t_i-t_i-1(t-t_i-1)\nendequation","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"Note that there is a discontinuity in derivative of the function u at each t_i for i = 2 ldots n-1.","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/#Smoothed-spline-corners","page":"Construction of smoothed linear interpolation","title":"Smoothed spline corners","text":"","category":"section"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"To get rid of the discontinuities mentioned in the previous section, we take out a section of the interpolation around each discontinuity and replace it with a spline curve.","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/#New-points","page":"Construction of smoothed linear interpolation","title":"New points","text":"","category":"section"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"For the construction of the smoothing we consider the consecutive points","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"    mathbfp_i-1 mathbfp_i mathbfp_i+1","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"Now we disregard mathbfp_i, and introduce 2 new points","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"beginequation\n    beginaligned\n        mathbfp_i-fraclambda2 = mathbfp_i - fraclambda2Deltamathbfp_i \n        mathbfp_i+fraclambda2 = mathbfp_i + fraclambda2Deltamathbfp_i+1\n    endaligned\nendequation","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"where Deltamathbfp_i = mathbfp_i - mathbfp_i-1 and lambda in 01. We will connect these points with a spline curve, and so lambda determines the size of the interval around mathbfp_i that is replaced by the spline curve.","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/#Deriving-the-spline-curve","page":"Construction of smoothed linear interpolation","title":"Deriving the spline curve","text":"","category":"section"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"We want to connect mathbfp_i-fraclambda2 and mathbfp_i+fraclambda2 with a smooth parametric curve ","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"beginequation\n    mathbfC_i  01 rightarrow mathbbR^2\nendequation","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"such that:","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"The connection can be expressed as ","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"beginequation\n    u_i  leftt_i - fraclambda2 t_i + fraclambda2right rightarrow mathbbR \nendequation","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"i.e. the t component of the curve must be invertible.","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"The connection is continuous, i.e.","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"beginequation\n    mathbfC_i(0) = mathbfp_i-fraclambda2 quad mathbfC_i(1) = mathbfp_i+fraclambda2\nendequation","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"The derivative of the connection is continuous, i.e.","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"beginequation\n    mathbfC_i(0) propto Deltamathbfp_i quad mathbfC_i(1) propto Deltamathbfp_i+1\nendequation","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"We can achieve this by repeated interpolation. The first interpolations are ","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"beginequation\n    beginaligned\n        mathbfC_i-fraclambda2(s) = (1-s)mathbfp_i-fraclambda2 + smathbfp_i \n        mathbfC_i+fraclambda2(s) = (1-s)mathbfp_i + smathbfp_i+fraclambda2\n    endaligned\nendequation","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"and combining these yields","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"beginequation\n    beginaligned\n        mathbfC_i(s) = (1-s)mathbfC_i-fraclambda2(s) + smathbfC_i+fraclambda2(s) \n        = (1-s)^2mathbfp_i-fraclambda2 + 2s(1-s)mathbfp_i + s^2mathbfp_i+fraclambda2 \n        = fraclambda2(Delta mathbfp_i+1 - Delta mathbfp_i)s^2 + lambda Delta mathbfp_i s + mathbfp_i-fraclambda2\n    endaligned\nendequation","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"Note that the second formulation tells us that C_i is a convex combination of mathbfp_i-fraclambda1 mathbfp_i mathbfp_i + fraclambda2 for all s in 01 and thus always is in the convex hull of these points.","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/#Writing-spline-curve-as-a-function-u(t)","page":"Construction of smoothed linear interpolation","title":"Writing spline curve as a function u(t)","text":"","category":"section"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"To write the spline curve as a function u(t), we first need to obtain s from t:","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"beginequation\n    T_i(s) = frac12lambda(Delta t_i+1 - Delta t_i)s^2 + lambdaDelta t_i s + t_i-fraclambda2 = t\nendequation","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"This yields","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"beginequation\n    S_i(t) = frac\n            -lambda Delta t_i + sqrtlambda^2Delta t_i^2 + 2lambda (Delta t_i+1 - Delta t_i)left(t - t_i-fraclambda2right)\n        \n            lambda (Delta t_i+1 - Delta t_i)\n        \nendequation","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"or, in the degenerate case that Delta t_i+1 - Delta t_i = 0 (i.e. the 3 points are equally spaced),","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"beginequation\n    S_i(t) = frac1lambdafract - t_i - fraclambda2Delta t_i\nendequation","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"Note that Delta t_i ne 0 by the assumption that the t_n are strictly increasing.","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"We conclude:","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"beginequation\n    u_i(t) = fraclambda2(Delta u_i+1 - Delta u_i)S_i(t)^2 + lambda Delta u_i S_i(t) + u_i - fraclambda2\n endequation","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/#Extrapolation","page":"Construction of smoothed linear interpolation","title":"Extrapolation","text":"","category":"section"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"We define Delta mathbfp_1 = Delta mathbfp_2 and Delta mathbfp_n+1 = Delta mathbfp_n. This yields","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"beginequation\n    u_1(t) = fracDelta u_2 Delta t_2(t - t_1) + u_1 quad t in leftt_1 t_1 + fraclambda2right\nendequation","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"and","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"beginequation\n    u_n(t) = fracDelta u_nDelta t_n(t - t_n) + u_n quad t in leftt_n - fraclambda2 t_nright\nendequation","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"This means that the interpolation is linear towards its boundaries and thus can be smoothly extended linearly.","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/#Evaluation","page":"Construction of smoothed linear interpolation","title":"Evaluation","text":"","category":"section"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"Once it is determined that the input t is in the interval t_i-1 t_i, the interpolation is evalued as follows:","category":"page"},{"location":"construction/construction_smoothed_linear_interpolation/","page":"Construction of smoothed linear interpolation","title":"Construction of smoothed linear interpolation","text":"beginequation\n    beginaligned\n        u_t_i-1 t_i(t) = \n        begincases\n            u_i-1(t) textif  t_i-1 leq t leq t_i - 1 + fraclambda2 \n            u_i-1 + fracDelta u_iDelta t_i(t - t_i-1) textif  t_i - 1 + fraclambda2 leq t leq t_i - fraclambda2 \n            u_i(t) textif  t_i - fraclambda2 leq t leq t_i\n        endcases\n    endaligned\nendequation","category":"page"},{"location":"#SmoothInterpolation.jl","page":"Home","title":"SmoothInterpolation.jl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"SmoothInterpolation.jl exports 2 interpolation types in the style of DataInterpolations.jl:","category":"page"},{"location":"","page":"Home","title":"Home","text":"SmoothedLinearInterpolation, a type of linear interpolation with well-behaved smoothed corners;\nSmoothedLinearInterpolationIntInv, the inverse of the antiderivative of a SmoothedLinearInterpolation if it exists.","category":"page"},{"location":"#Installation","page":"Home","title":"Installation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"n/a","category":"page"}]
